import React, { Component } from "react";
import "./header.css";
import logo1 from "../images/logo-saensukcity.png";
import {
  Container,
  Navbar,
  Nav,
} from "react-bootstrap";

class Header extends Component {
  render() {
    return (
      <Container fluid>
        <Navbar bg="light" expand="lg" fluid>
          <Navbar.Brand href="#home"><img className="header-logo" src={logo1} /></Navbar.Brand>
          <Nav.Link href="#home">Project Name</Nav.Link>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link href="#home" className="header-link">Home</Nav.Link>
              {/* <Nav.Link href="#link">Link</Nav.Link>
              <NavDropdown title="Dropdown" id="basic-nav-dropdown">
                <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">
                  Another action
                </NavDropdown.Item>
                <NavDropdown.Item href="#action/3.3">
                  Something
                </NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="#action/3.4">
                  Separated link
                </NavDropdown.Item>
              </NavDropdown> */}
            </Nav>
            <p className="header-link">Log out!</p>
          </Navbar.Collapse>
        </Navbar>
      </Container>
    );
  }
}

export default Header;
